	@SubscribeEvent
	public static void clientLoad(FMLClientSetupEvent event) {
		event.enqueueWork(() -> {
			ItemProperties.register(PISTOL_ITEM.get(), new ResourceLocation("art5019injustice:pistol_item_skin"), (itemStackToRender, clientWorld, entity, itemEntityId) -> (float) PistolItemPropertyValueProviderProcedure.execute(itemStackToRender));
			ItemProperties.register(CONDIMENT_GUN.get(), new ResourceLocation("art5019injustice:condiment_gun_sauce"),
					(itemStackToRender, clientWorld, entity, itemEntityId) -> (float) CondimentGunPropertyValueProviderProcedure.execute(itemStackToRender));
			ItemProperties.register(CONDIMENT_GUN.get(), new ResourceLocation("art5019injustice:condiment_gun_shots"),
					(itemStackToRender, clientWorld, entity, itemEntityId) -> (float) CondimentGunPropertyValueProvider2Procedure.execute(itemStackToRender));
			ItemProperties.register(INTERDIMENSIONAL_EXTRAPOLATOR.get(), new ResourceLocation("art5019injustice:interdimensional_extrapolator_extrapolator_activated"),
					(itemStackToRender, clientWorld, entity, itemEntityId) -> (float) InterdimensionalExtrapolatorPropertyValueProviderProcedure.execute(itemStackToRender));
			ItemProperties.register(FREQUENCY_EMITTER_TNT.get(), new ResourceLocation("art5019injustice:frequency_emitter_tnt_turnedon"),
					(itemStackToRender, clientWorld, entity, itemEntityId) -> (float) FrequencyEmitterTNTPropertyValueProviderProcedure.execute(itemStackToRender));
			ItemProperties.register(INVISIBLE_TEXT_TEST.get(), new ResourceLocation("art5019injustice:invisible_text_test_ownervisibility"),
					(itemStackToRender, clientWorld, entity, itemEntityId) -> (float) ReturnOwnerVisibilityProcedure.execute(entity));
			ItemProperties.register(CAPTAIN_CARTER_VIBRANIUM_SHIELD.get(), new ResourceLocation("blocking"), ItemProperties.getProperty(Items.SHIELD, new ResourceLocation("blocking")));
			ItemProperties.register(OLD_PISTOL.get(), new ResourceLocation("art5019injustice:old_pistol_skin"), (itemStackToRender, clientWorld, entity, itemEntityId) -> (float) PistolItemPropertyValueProviderProcedure.execute(itemStackToRender));
		});
	}
